      <div class="sign_up">
        <div class="header">
          <h1>sign up</h1>
          <div>
            <span>Already have an account?</span>
            <span><a href="">log in</a></span>
          </div>
        </div>
        <!--the form-->
        <form action="">
          <!--full name-->
          <label for="">Full name</label>
          <input type="text" name="fullName" id="fullName" />
          <!--country-->
          <select name="country" id="country" aria-placeholder="country">
            <option value="country">country</option>
            <option value="egypt">egypt</option>
          </select>
          <!--email-->
          <label for="email">Email</label>
          <input type="text" name="email" id="email" />
          <!--pasword-->
          <label for="password">password</label>
          <input type="password" name="password" id="password" />
          <!--recieve-->
          <div>
            <input type="checkbox" name="recieve" id="recieve">
          <label for="recieve">recieve email updates</label>
          </div>
          <!--btn-->
          <button>sign up</button>
        </form>
        <!--paragraph-->
        <p class="policy">by singing up you agreeto our
          <br><span>privacy</span> & <span>terms of services</span> 
        </p>
